import FacebookLogin from 'react-facebook-login';

const Login = () => {

  const handleResponse = (response) => {
    console.log(response);
  };

  return (
    <div>
      <FacebookLogin
        appId="1497912747302346"
        fields="name,email"
        callback={handleResponse}
      />
    </div>
  );
};

export default Login;
